 import React from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';
import { Link } from 'react-router-dom';
import './Header.css'; // Import custom CSS for Header styling
import ScrollToTop from './ScrollTop';
const Header = () => {
return (
<AppBar position="fixed" className="app-bar" elevation={0} style={{backgroundColor:'white', color:'black', fontWeight:'bold'}}>
<Toolbar>
<ScrollToTop/>
<Typography variant="h6" style={{ flexGrow: 0, fontWeight:'bold' }}>
My Portfolio
</Typography>
<Button style={{ marginLeft:'750px' }} component={Link} to="home" color="inherit">Home</Button>
<Button component={Link} to="aboutMe" color="inherit">About</Button>
<Button component={Link} to="projects" color="inherit">Projects</Button>
<Button component={Link} to="contact" color="inherit" > <a href='#Contact' style={{textDecoration:'none'}}>COntact</a></Button>
</Toolbar>
</AppBar>
);
};

export default Header;
